// Set cookie expiry date
function setCookie(cname, cvalue, exdays) {
    var d = new Date();
    d.setTime(d.getTime() + (exdays*24*60*60*1000));
    var expires = "expires="+d.toUTCString();
    document.cookie = cname + "=" + cvalue + "; " + expires + ";path=/";
}

function getCookie(cname) {
    var name = cname + "=";
    var ca = document.cookie.split(';');
    for (var i = 0; i < ca.length; i++) {
        var c = ca[i];
        while (c.charAt(0) == ' ') c = c.substring(1);
        if (c.indexOf(name) == 0) return c.substring(name.length, c.length);
    }
    return "";
}

$(document).ready(function() {
    // Define variables
    var widget = $('.cookie-consent');
    var widgetButton = $('.cookie-consent__button');
    var expiryLength = $(widget).attr("data-expire");
    var cookie = getCookie('bytewaxCookieConsent');

    // Check if cookie was already set
    if (cookie == '') {
        widget.fadeIn();
    } else {
        widget.hide();
    }

    // Hide widget on button click
    widgetButton.click(function(){
        setCookie('bytewaxCookieConsent', 'hide', expiryLength);
        $(widget).fadeOut();
    });
});
$(document).ready(function() {
    // Docs sidebar accordion
    $('.docs__nav-toggle').click(function(e){
        (e).preventDefault();
        var nav = $('.docs__nav');
        var item = $(this).parent();
        var dropdown = $(item).find('.docs__nav-dropdown');

        // Open dropdown of clicked item
        if($(item).hasClass('docs__nav-item--active')){
            $(dropdown).slideToggle(function(){
                $(item).toggleClass('docs__nav-item--active');
            });
        } else {
            $(dropdown).slideToggle();
            $(item).toggleClass('docs__nav-item--active');
        }

        // Close already opened elements
        $(nav).find('.docs__nav-item--active').not(item).each(function(){
            $(this).find('.docs__nav-dropdown').slideToggle();
            $(this).removeClass('docs__nav-item--active');
        });
    });

    // Table of contents -- Fill list with links to h2 headlines
    $('.docs__content h2').each(function(){
        // Get the h2 element attributes from DOM and create li element with link to it
        var id = $(this).attr('id');
        var label = $(this).text();
        var element = $('<li class="docs__toc-item"><a href="#'+ id +'" class="docs__toc-link">'+ label +'</a></li>' );
        
        // Specify list in DOM
        var toc = $('.docs__toc-list');

        // Append each created element to the list
        $(element).appendTo(toc);
    });

    // Table of contents -- Smooth scroll to ID 
    $('.docs__toc-link').click(function(e){

        e.preventDefault();
        var nav = $('.docs__toc-list');
        var item = $(this).parent();

        // target element
        var id = $(this).attr('href');
        var $id = $(id);
        if ($id.length === 0) {
            return;
        }
        
        // Add active class to parent element (li)
        $(item).toggleClass('docs__toc-item--active');
        
        // Remove active class from rest of the elements
        $(nav).find('.docs__toc-item--active').not(item).each(function(){
            $(this).removeClass('docs__toc-item--active');
        });

        // Top position relative to the document
        var pos = $id.offset().top - 128;

        // Animated top scrolling
        $('body, html').animate({scrollTop: pos});

    });
    

    // Table of contents -- Scrollspy (change active class on scroll)
    var headlines = $('.docs__content').find('h2');

    // Iterate through all headlines and set scrollspy function on them
    headlines.each(function(index) {

        // Get the position of current headline
        var position = $(this).position();
        
        // Get the position of the next headline to set sectionHeight
        if(index !== headlines.length - 1) {
            var sectionHeight = headlines.eq(index + 1).position().top;
        } else {
            var sectionHeight = position.top + $(this).height()
        }

        // Add scrollspy to the current headline
        $(this).scrollspy({
            min: position.top,
            max: sectionHeight,
            onEnter: function(element) {
                // Add 'active' class to element visible on viewport
                var item = $('a[href="#' + element.id + '"]').parent();
                $(item).addClass('docs__toc-item--active');

                // Remove active class from items previously labeled as active
                $('.docs__toc-list').find('.docs__toc-item--active').not(item).each(function(){
                    $(this).removeClass('docs__toc-item--active');
                });
            }
        });
    });
});
$(document).ready(function() {
    // Toggle navigation (tablet & mobile)
    $('.navbar__toggler').click(function(e){
        (e).preventDefault();
        var nav = $(this).parent().find('.navbar__nav');
        $('.navbar').toggleClass('navbar--open');
        $(this).toggleClass('navbar__toggler--open');
        if($(this).hasClass('navbar__toggler--open')){
            $(nav).css("display", "flex").hide().fadeIn();
        } else {
            $(nav).fadeOut();
        }
    });

    // Open / close dropdown menu on click
    $('.navbar__nav-link--dropdown').click(function(e){
        (e).preventDefault();

        // Toggle link class
        $(this).toggleClass('navbar__nav-link--dropdown-open');

        // Get dropdown element
        var dropdown = $(this).parent().find('.navbar__nav-dropdown');

        // If other dropdowns were already opened, close them
        $('.navbar__nav-dropdown--open').not(dropdown).each(function(){
            $(this).parent().find('.navbar__nav-link--dropdown').removeClass('navbar__nav-link--dropdown-open');
            $(this).fadeOut().removeClass('navbar__nav-dropdown--open');
        });
        
        // If link has specific class, open/close dropdown element
        if($(this).hasClass('navbar__nav-link--dropdown-open')){
            $(dropdown).fadeIn().addClass('navbar__nav-dropdown--open');
        } else {
            $(dropdown).fadeOut().removeClass('navbar__nav-dropdown--open');
        }

    });

    // Close already opened dropdowns while clicking outside
    $(document).click(function(e){
        if( (!$(e.target).hasClass('navbar__nav-link--dropdown')) && (!$(e.target).closest(".navbar__nav-dropdown").length > 0) ){
            $('.navbar__nav-dropdown--open').each(function(){
                $(this).parent().find('.navbar__nav-link--dropdown').removeClass('navbar__nav-link--dropdown-open');
                $(this).fadeOut().removeClass('navbar__nav-dropdown--open');
            });
        }
    });

    // Check local storage to get preferred colorMode
    var colorMode = localStorage.getItem('colorMode');
    if (colorMode == 'dark'){
        $('.navbar__switch').removeClass('navbar__switch--light').addClass('navbar__switch--dark');
    }

    // Toggle between dark & light mode
    $('.navbar__switch').click(function(e){
        (e).preventDefault();
        if ($(this).hasClass('navbar__switch--light')){
            $(this).removeClass('navbar__switch--light').addClass('navbar__switch--dark');
            $('body').addClass('dark-mode');

            // Set preferred color scheme in localStorage
            localStorage.setItem('colorMode', 'dark');
        } else {
            $(this).removeClass('navbar__switch--dark').addClass('navbar__switch--light');
            $('body').removeClass('dark-mode');
            
            // Set preferred color scheme in localStorage
            localStorage.setItem('colorMode', 'light');
        }
    });

    // Define navbar background (white & transparent) depending on scroll position
    if ($(window).scrollTop() >= $('.navbar').position(top)) {
        $('.navbar').removeClass('navbar--scroll'); 
    } else if ($(window).scrollTop() === 0){
        $('.navbar').removeClass('navbar--scroll'); 
    } else {
        $('.navbar').addClass('navbar--scroll');
    }
    $(window).scroll(function () {
        var scroll = $(window).scrollTop();
        if (scroll >= 60) {
            $('.navbar').addClass('navbar--scroll');
        } else {
            $('.navbar').removeClass('navbar--scroll'); 
        }
    });
});
